import React from 'react';
import Typical from 'react-typical';
import './Terminal.css';

const Terminal = () => {
  return (
    <div className='terminal'>
      <p>
        <Typical
          steps={['Welcome to my portfolio...', 2000, 'Type "help" for commands...', 1000]}
          loop={Infinity}
          wrapper="span"
        />
        <span className="blinking-cursor">|</span>
      </p>
    </div>
  );
};

export default Terminal;
